import React from 'react';
import './Skill.css';
import Card from './Card';
import img1 from '../../images/ux.png';
import img2 from '../../images/css-file.png';
import img3 from '../../images/javascript.png';
import img4 from '../../images/science.png';
import img5 from '../../images/nodejs.png';
import img6 from '../../images/server.png';
export default function Skill(){

    const title=["UI|UX","HTML|CSS","JavaScript","React","NodeJs","MongoDB"];
    const des=["UI is very important as it attracts the user and increase the traffic on website",
        "HTML is the base of any website and CSS is important to make website look attractive",
       "JavaScript is the mind of the Website . It makes website functional and more attractive",
       "React library is one of the most used library for developing FrontEnd part of website",
       "NodeJs is a BackEnd Technology which is in High Demand now a days ",
       "MongoDB is one of the best BackEnd Data base used in website" ]

    return(
        <>
        <div className="panel s"  id='s'>
               <h2 className='s-title'>Services</h2>
               <h4 className='s-des'>I Design, I Code, I Create : It's that simple</h4>
               <div className="s-wrapper" id='s-w'>
                   <Card image={img1} title={title[0]} des={des[0]} />
                   <Card image={img2} title={title[1]} des={des[1]} />
                   <Card image={img3} title={title[2]} des={des[2]} />
                   <Card image={img4} title={title[3]} des={des[3]} />
                   <Card image={img5} title={title[4]} des={des[4]} />
                   <Card image={img6} title={title[5]} des={des[5]} />
               </div>
                <div className="circles">
                    <div className="one" id="1" onClick={()=>{
                        document.getElementById("1").style.backgroundColor="#009ffd";
                        document.getElementById("2").style.backgroundColor="rgb(252,247,241)";
                        document.getElementById("3").style.backgroundColor="rgb(252,247,241)";
                        document.getElementById("s-w").style.left="0";
                    }}></div>
                    <div className="two" id='2' onClick={()=>{
                        document.getElementById("2").style.backgroundColor="#009ffd";
                        document.getElementById("1").style.backgroundColor="rgb(252,247,241)";
                        document.getElementById("3").style.backgroundColor="rgb(252,247,241)";
                        document.getElementById("s-w").style.left="-100vw";
                    }}></div>
                    <div className="three" id='3' onClick={()=>{
                        document.getElementById("3").style.backgroundColor="#009ffd";
                        document.getElementById("1").style.backgroundColor="rgb(252,247,241)";
                        document.getElementById("2").style.backgroundColor="rgb(252,247,241)";
                        document.getElementById("s-w").style.left="-200vw";
                    }}></div>
                </div>
        </div>
        </>
    )
}
